  constructor (props) {
    super(props);
    this.state = {
      items: [
        {
          id: 0,
          title: '',
          description: '',
          imgSrc: '',
          link: '',
          selected: false
        },
        {
          id: 1,
          title: '',
          description: '',
          imgSrc: '',
          link: '',
          selected: false
        },
        {
          id: 2,
          title: '',
          description: '',
          imgSrc: '',
          link: '',
          selected: false
        }
      ]
    };
  }

  render () {
    return (
      <ProjectCard />
    );
  }
}

